    return (
      <div className="App">
        <ul>
          <Link></Link>
            <li>Home</li>
            <li>Sejarah</li>
            <li>Tentang</li>
            <li>Kontak</li>
        </ul>
      </div>
    )
  }
  
  export default Nav;
